import React, {Component} from 'react'
import './App.css';
import './index.css'
// import Card from 'react-bootstrap/Card';
import {Container, Row, Col, Card} from "react-bootstrap";

import axios from 'axios';
import Dashboard from './Dashboard';
import {useState, useEffect} from "react";

function App() {
    return (
        <div className="App">
            <div className="AppFirstTile">
                <Card>
                    <Card.Body>
                        <Card.Title>TOTAL ORDERS</Card.Title>
                        <Card.Text>
                            1000
                        </Card.Text>
                    </Card.Body>
                </Card>
            </div>
            <div className="AppSecondTile">
                <Card>
                    <Card.Body>
                        <Card.Title>TOTAL MONTHLY ORDERS</Card.Title>
                        <Card.Text>
                            1000
                        </Card.Text>
                    </Card.Body>
                </Card>
            </div>
            <div className="AppThirdTile">
                <Card>
                    <Card.Body>
                        <Card.Title>TOTAL ORDERS IN PROGRESS</Card.Title>
                        <Card.Text>
                            1000
                        </Card.Text>
                    </Card.Body>
                </Card>
            </div>
            <div className="AppFourthTile">
                <Card>
                    <Card.Body>
                        <Card.Title>REVENUE</Card.Title>
                        <Card.Text>
                            1000
                        </Card.Text>
                    </Card.Body>
                </Card>
            </div>
        </div>
    );
}

export default App;

